from PIL import Image
import os
import subprocess
import requests
import io
from io import BytesIO
import base64
base = ""
img_data = base64.b64decode(base)
background = Image.open(BytesIO(img_data))

def create_dir():
    if not os.path.exists("results"):
        os.makedirs("results")

def replace():
    global pic, ext, w
    pic = input("\033[1m\033[0m\033[1m\033[0m")  # 
    response()
    if w == 0:
        if '"' in pic:
            pic = pic.replace('"', '')  # 
        ext = os.path.splitext(pic)[1]  # 

def response():
    global w
    global pic
    if "http" in pic or "https" in pic:
        pic_response = requests.get(pic)
        if pic_response.status_code == 200:  # GET 200 OK
            #  BytesIO 
            global image_bytes
            image_bytes = io.BytesIO(pic_response.content)
            w = 1
        else:
            print(pic_response.status_code)
            print("")
            exit()
    else:
        w = 0

def wis1():
        global image_path
        image_path = f"results/{name}.jpg"
        if os.path.exists(image_path):
            new_name = input(f"\033[1m{name}.jpg\033[0m(\033[1m\033)")
            if new_name == "":
                background.save(image_path)
            else:
                image_path = f"results/{new_name}.jpg"
                background.save(image_path)
        else:
            background.save(image_path)
def wis0():
        global image_path
        image_path = f"results/{name}{ext}"
        if os.path.exists(image_path):
            new_name = input(f"\033[1m{name}{ext}\033[0m(\033[1m\033)")
            if new_name == "":
                background.save(image_path)
            else:
                image_path = f"results/{new_name}{ext}"
                background.save(image_path)
        else:
            background.save(image_path)
def save():
    if name == "":
        background.show()
    else:
        if w == 1:
            wis1()
        else:
            wis0()
        print(f"{image_path}")
        subprocess.run(['start', image_path], shell=True)  # 

if __name__ == '__main__':
    create_dir()
    replace()
    
    if w == 1:
        overlay = Image.open(image_bytes)  # 
    else:
        overlay = Image.open(pic)  # 
        
    if overlay.mode != 'RGBA':  # RGBARGBA
        overlay = overlay.convert('RGBA')
    
    overlay = overlay.resize((600, 600))  # 
    position = (680, 100)  # background
    background.paste(overlay, position, overlay)  # 
    
    # 
    name = input("\033[1m\033[0m(\033[1m\033[1m\033[0m)")
    save()
